import React, {Component} from 'react';

class ListBuilder extends Component {
    state= {
        people: [
            {
                id: 1,
                name: 'Alton',
                attendence: true
            },
            {
                id: 2,
                name: 'Gladys',
                attendence: true
            },
            {
                id: 3,
                name: 'Steph',
                attendence: true
            },
        ]
    }
    render() {
        return (
            <div>
                <h1>Names list</h1>
                <ul>
                    <li>Person's name is Alton</li>
                </ul>
            </div>
        )
    }
}

export default ListBuilder;
